<div class="text-container"><span class="t sz" style="left:69px;bottom:1090px;letter-spacing:0.18px;">Article 4 : Responsabilits </span>
<span class="t s13" style="left:69px;bottom:1057px;letter-spacing:0.15px;">Responsabilit de mon accompagnateur Renov </span>
<span class="t s1" style="left:69px;bottom:1033px;letter-spacing:-0.01px;">Il est entendu, conformment  l'Arrt du 21 dcembre 2022 cit ci-dessus, que </span>
<span class="t s1" style="left:69px;bottom:1015px;letter-spacing:-0.01px;">-  Mon Accompagnateur Rnov'  est responsable du conseil et de l'assistance au mnage pendant la dure de la </span>
<span class="t s1" style="left:69px;bottom:997px;letter-spacing:-0.01px;">prestation </span>
<span class="t s1" style="left:69px;bottom:979px;letter-spacing:-0.01px;">- L'accompagnateur n'est pas responsable de l'excution des travaux et de leur bonne ralisation, ni du choix du </span>
<span class="t s1" style="left:69px;bottom:961px;letter-spacing:-0.01px;">projet de travaux effectu par le mnage. </span>
<span class="t s1" style="left:69px;bottom:942px;letter-spacing:-0.01px;">- L'accompagnateur n'est pas responsable de la qualit finale des travaux, dans la mesure o ceux-ci relvent du </span>
<span class="t s1" style="left:69px;bottom:924px;letter-spacing:-0.01px;">choix du mnage. En revanche, il est tenu d'informer le mnage des dfauts de qualit et des recours possibles en </span>
<span class="t s1" style="left:69px;bottom:906px;letter-spacing:-0.01px;">cas de persistance de malfaons, ainsi que des assurances dommages-ouvrage accessibles </span>
<span class="t s13" style="left:69px;bottom:878px;letter-spacing:0.13px;">Responsabilit du bnficiaire </span>
<span class="t s1" style="left:69px;bottom:854px;letter-spacing:-0.01px;">Le bnficiaire est responsable de : </span>
<span class="t s1" style="left:97px;bottom:796px;letter-spacing:-0.01px;">- La sincrit et de l'exactitude des informations et documents fournis durant toute la prestation. </span>
<span class="t s1" style="left:97px;bottom:778px;letter-spacing:-0.01px;">- La dcision du choix de projet de travaux effectus, de leur excution y compris de leur bonne ralisation. </span>
<span class="t sz" style="left:69px;bottom:729px;letter-spacing:0.18px;">Article 5 : Mandat Administratif et / ou Financier </span>
<span class="t s1" style="left:69px;bottom:709px;letter-spacing:-0.01px;">Le bnficiaire mandate laccompagnateur rnov pour recevoir en son nom et pour son compte propre les honoraires </span>
<span class="t s1" style="left:69px;bottom:690px;letter-spacing:-0.01px;">comme indiqu  larticle 7 pour la ralisation de la mission daccompagnement. </span>
<span class="t s1" style="left:69px;bottom:657px;letter-spacing:-0.01px;">Le bnficiaire donne mandat  laccompagnateur rnov pour la ralisation de toutes dmarches administratives </span>
<span class="t s1" style="left:69px;bottom:639px;letter-spacing:-0.01px;">visant  obtenir une subvention dans le cadre de financement de travaux nergtique. </span>
<span class="t s1" style="left:69px;bottom:606px;letter-spacing:-0.01px;">Ce mandat administratif inclut, si ncessaire, la cration du compte sur linterface ; https://monprojet.anah.gouv.fr en </span>
<span class="t s1" style="left:69px;bottom:588px;letter-spacing:-0.01px;">utilisant une adresse lectronique spcifiquement crer pour cette demande. </span>
<span class="t sz" style="left:69px;bottom:539px;letter-spacing:0.17px;">Article 6 : Dure et rsiliation du contrat </span>
<span class="t s13" style="left:69px;bottom:506px;letter-spacing:0.13px;">Dure et fin du contrat </span>
<span class="t s1" style="left:69px;bottom:482px;letter-spacing:-0.01px;">Le contrat prend effet  sa date de signature pour prendre fin  la date de la signature du rapport </span>
<span class="t s1" style="left:69px;bottom:464px;letter-spacing:-0.01px;">daccompagnement. Si le bnficiaire nest pas satisfait de lensemble de la prestation, il lui appartient de faire </span>
<span class="t s1" style="left:69px;bottom:446px;letter-spacing:-0.01px;">connatre par crit  laccompagnateur rnov les prestations quil estime incompltes ou non excutes avant la </span>
<span class="t s1" style="left:69px;bottom:428px;letter-spacing:-0.01px;">signature du rapport daccompagnement. </span>
<span class="t s1" style="left:69px;bottom:409px;letter-spacing:-0.01px;">La mission daccompagnement prendra donc fin  la date de signature du rapport daccompagnement dfinit en j de </span>
<span class="t s1" style="left:69px;bottom:391px;letter-spacing:-0.01px;">larticle 2 du prsent contrat. </span>
<span class="t s13" style="left:69px;bottom:363px;letter-spacing:0.13px;">Rsiliation du contrat par le bnficiaire </span>
<span class="t s1" style="left:69px;bottom:336px;letter-spacing:-0.01px;">Le contrat peut tre rsili par le bnficiaire  tout moment par lettre recommande avec accus de rception. </span>
<span class="t s13" style="left:69px;bottom:308px;letter-spacing:0.12px;">Rsiliation de plein droit </span>
<span class="t s1" style="left:69px;bottom:281px;letter-spacing:-0.01px;">En cas dinexcution de lune des obligations des parties, lautre parties devra adresser une mise en demeure par </span>
<span class="t s1" style="left:69px;bottom:263px;letter-spacing:-0.01px;">lettre recommande avec accus de rception prcisant les manquements reprochs. Si la mise en demeure est </span>
<span class="t s1" style="left:69px;bottom:245px;letter-spacing:-0.01px;">reste sans effet dans un dlai de sept jours  compter de sa rception, le contratsera,si bon semble au crancier de </span>
<span class="t s1" style="left:69px;bottom:226px;letter-spacing:-0.01px;">lobligation inexcut, rsili de plein droit. </span>
<span class="t sz" style="left:69px;bottom:195px;letter-spacing:0.19px;">Article 7 : Honoraire de la mission daccompagnateur rnov </span>
<span class="t s1" style="left:69px;bottom:169px;letter-spacing:-0.01px;">Le prsent contrat est conclu  titre onreux. </span>
<span class="t s1" style="left:69px;bottom:150px;letter-spacing:-0.01px;">Laccompagnateur rnov percevra une rmunration de 2 000  TTC. Ces honoraires seront pris en charge par </span>
<span class="t s1" style="left:69px;bottom:132px;letter-spacing:-0.01px;">lANAH  hauteur de : </span>
<span class="t s1" style="left:191px;bottom:75px;letter-spacing:-0.03px;word-spacing:0.01px;">VALOREM SASU au capital social 20 000,00  - RCS BOBIGNY B 913 753 000 </span>
<span class="t s1" style="left:134px;bottom:56px;letter-spacing:-0.01px;">Code NAF ingnierie tudes Techniques (7112B) - N TVA intracommunautaire FR18913753000 </span>
<span class="t s11" style="left:254px;bottom:39px;letter-spacing:-0.13px;">N d'Agrement Mon Accompagnateur Rnov' : MAR-93-0002122 </span></div>

